USE klassez;

DROP TABLE IF EXISTS ingredients;
DROP TABLE IF EXISTS foods;
DROP TABLE IF EXISTS foodGroups;
DROP TABLE IF EXISTS recipes;
DROP TABLE IF EXISTS savedFoods;
DROP TABLE IF EXISTS users;

CREATE TABLE IF NOT EXISTS ingredients (
ingredient varchar(500),
numberOfServings varchar(200),
recipeId int
);

CREATE TABLE IF NOT EXISTS foods (
foodId int PRIMARY KEY AUTO_INCREMENT,
foodName varchar(500),
servingPortion int,
foodGroupId int,
totalCalories int,
totalFat int,
transFat int,
saturatedFat int,
cholesterol int,
sodium int,
totalCarbohydrate int,
sugars int,
protein int
);

CREATE TABLE IF NOT EXISTS foodGroups (
id int PRIMARY KEY AUTO_INCREMENT,
foodGroup varchar(50)
);

CREATE TABLE IF NOT EXISTS recipes (
recipeId int PRIMARY KEY AUTO_INCREMENT,
recipeName varchar(500),
userId int
);

CREATE TABLE IF NOT EXISTS savedFoods (
userId int,
foodId int,
PRIMARY KEY(userId, foodId)
);

CREATE TABLE IF NOT EXISTS likedFoods (
userId int,
foodId int,
PRIMARY KEY(userId, foodId)
);

CREATE TABLE IF NOT EXISTS dislikedFoods (
userId int,
foodId int,
PRIMARY KEY(userId, foodId)
);

CREATE TABLE IF NOT EXISTS users (
userId int PRIMARY KEY AUTO_INCREMENT,
firstName varchar(100),
lastName varchar(100),
emailAddress varchar(100),
username varchar(100),
password varchar(100),
isAdmin int,
description varchar(500)
);

